(3262, 181, 418, 1, 'Logic', '作者：Min\n源自EnterStereo的Heaven Trip專輯中第2首「EnterStereo Feat Dj Suhi Logic Album Version」延生出來的。經KS在Logic中原曲中只運用16小節旋律的巧奪天工的改編下，除了讓人有著像遨遊天際的快感一般外，更再創拓展延生出另一個音樂新世界。\n\n整首曲從開始播放的第一秒到結束，讓人像是在經歷著穿越燦爛無比的電音隧道。一段又一段豐富的音樂組成及構造性的創造，雙眼彷彿在闔眼享受的一瞬間，會看到廣闊大海的雄偉。\n\n「EnterStereo Feat Dj Suhi Logic Album Version」原曲像是為世人指引光明的道路一般，不管你在追求什麼，音樂中不時出現的「Be myself」像是在提醒你做什麼絕對要相信自己的抉擇。\n\n雖然長久以來聽電音的人在台灣佔了不少的數量，但實際全心投入在台灣電音工業的人實在是不成比例。因此KS的Logic - Rifacimento by KS為這首曲注入這麼多令人感動的因子，就更顯珍貴。但願這首Masterpiece為KS開啟通往成為電子音樂大師的康莊大道，也更期他源源不絕的創作，可以為我們生活帶來更多的義意。\n\n簡介：KS\n很榮幸能將EnterStereo的Logic做一個延生拓展部份，起初聽到此作品非常喜歡！因此之下有了一些想法而主動請原作者同意改編，很高興能在這樣的同類型的創作人彼此互相有共同的理念。\n\n想像空間對我來說並不難，延生不一樣的聽覺就像是重新穿上新衣服一樣感覺，但是衣服的款式也是需要看元素來決定，除了品牌、舒適、合適、整體感…這些在原設計者就已經是頂級的水平，而KS再將以原設計主題拆開創意縫合想像創造跟原款不同的變化，這一創作讓同款性質的東西起了非常大的變化性，讓歌曲變的更與眾不同！驚艷了試穿者的極滿意程度。\n\n您呢？是否想來試試這不同的感覺？讓您嘗試這不同味道的聽覺感受。絕對能讓您改觀您映象中的台灣電子音樂！原創魅力新風格正在潛入您的意識，徹底的被征服…\n\n作品年份：2008/04\n更多凱斯音樂作品：http://www.kevinsu.tw', '2008-05-10 00:00:00', 0000, 20, 0, 3, '', '', 448, '', 'KS (Kevin Su)', '', 'KS (Kevin Su)', '凱斯音樂、回聲唱片', '', 0, 1, 0, '2008-05-09 08:22:51', '2015-03-12 13:31:41', '0000-00-00 00:00:00'),
